const ProductDetail = (props) => {
    const keys = [];
    for (const key in props.product[0]) {
        keys.push(key)
    }
    return <div>
        {keys.map((item, i) => {
            return props.product[0][item].length > 1 ?
                <li key={props.product[0].id}>{[item]}: {props.product[0][item]}</li>
                :
                <li key={props.product[0].id}>{[item]}: {props.product[0][item].map(el => <p>{el}</p>)}</li>
        })}
    </div>
}

export default ProductDetail
